[{"location":"api/#API-Reference","page":"API Reference","title":"API Reference","text":"The API reference below is generated from docstrings in the source code.","category":"section"},{"location":"api/#Index","page":"API Reference","title":"Index","text":"","category":"section"},{"location":"api/#DocStrings","page":"API Reference","title":"DocStrings","text":"","category":"section"},{"location":"api/#MyPkg49.hello-Tuple{}","page":"API Reference","title":"MyPkg49.hello","text":"hello() -> String\n\n\n\n\n\n\n","category":"method"},{"location":"developer/#Developer-Guide","page":"Developer Guide","title":"Developer Guide","text":"Open an issue before starting significant work. The ColPrac guidelines is recommended.","category":"section"},{"location":"developer/#Local-Setup","page":"Developer Guide","title":"Local Setup","text":"This procedure is required only once. Install Revise.jl and Runic.jl, and clone this repository.\n\n# Install Tools\njulia --startup-file=no -e 'import Pkg; Pkg.add(\"Revise\")'\njulia --project=@runic --startup-file=no -e 'using Pkg; Pkg.add(\"Runic\")'\n\n# Clone Repo\ngit clone https://github.com/ohno/MyPkg49.jl.git\ncd MyPkg49.jl\n\n# Start Session\njulia --startup-file=no -i -E 'using Revise; import Pkg; Pkg.activate(\".\"); using MyPkg49' \n\nYou're ready to start with the Step 3 of How to develop a Julia package.\n\nhttps://pkgdocs.julialang.org/v1/creating-packages/","category":"section"},{"location":"developer/#Development-Flow","page":"Developer Guide","title":"Development Flow","text":"Start an interactive session with Revise.jl.\nChange codes.\n\nDocString https://documenter.juliadocs.org/stable/man/guide/#Adding-Some-Docstrings\nUse julia --project=. --startup-file=no -e 'import Pkg; Pkg.add(\"Something\"); Pkg.resolve(); Pkg.instantiate()' to add Something.jl as a dependency. Project.toml will be updated.\n\nRun formatter. This project uses Runic, a code formatter with rules set in stone. Runic have no configuration.\nRun the local test suite before pushing commits. Aqua.jl and JET.jl\nBuild the documentation locally. Run the first command once to set up the docs environment, and run the second command to rebuild the documentation.\n\n# Start with Revise.jl\ncd MyPkg49.jl\njulia --startup-file=no -i -E 'using Revise; import Pkg; Pkg.activate(\".\"); using MyPkg49'\n\n# Run Formatter\njulia --project=@runic --startup-file=no -e 'using Runic; Runic.main([\"--inplace\", \"src/\"])'\n\n# Run Test\njulia --project=. --startup-file=no -e 'using Pkg; Pkg.test()'\n\n# Generate Documentation\njulia --project=docs --startup-file=no -e 'using Pkg; Pkg.develop(PackageSpec(path=pwd())); Pkg.instantiate();'\njulia --project=docs --startup-file=no -e 'include(\"docs/make.jl\")'","category":"section"},{"location":"developer/#Versioning-and-Registering-(for-Maintainers)","page":"Developer Guide","title":"Versioning and Registering (for Maintainers)","text":"This project follows Semantic Versioning. When bumping the version, update the version number in:\n\nProject.toml\nCITATION.bib\n\nFor registering this package to the General registry, install Registrator and use via the GitHub App.","category":"section"},{"location":"user/#User-Guide","page":"User Guide","title":"User Guide","text":"Before starting the tutorial, please complete the Installation and Quick Start sections first.","category":"section"},{"location":"user/#Tutorial","page":"User Guide","title":"Tutorial","text":"import MyPkg49\nMyPkg49.hello()","category":"section"},{"location":"user/#Examples","page":"User Guide","title":"Examples","text":"import MyPkg49\ntext_1 = MyPkg49.hello()\ntext_2 = \"Goodbye, World!\"\ntext_1 * \" \" * text_2","category":"section"},{"location":"#MyPkg49.jl","page":"Home","title":"MyPkg49.jl","text":"(Image: Stable) (Image: Dev) (Image: Build Status) (Image: Coverage) (Image: License) (Image: Aqua QA) (Image: JET Test) (Image: code style: runic) (Image: ColPrac: Contributor's Guide on Collaborative Practices for Community Packages)\n\nA Julia package for solving my problems.","category":"section"},{"location":"#Installation","page":"Home","title":"Installation","text":"Run the following command in the Julia REPL or in a notebook:\n\njulia> import Pkg; Pkg.add(url=\"https://github.com/ohno/MyPkg49.jl.git\")","category":"section"},{"location":"#Quick-Start","page":"Home","title":"Quick Start","text":"After installation, run the following example to load the package and verify it works:\n\nimport MyPkg49; MyPkg49.hello()","category":"section"},{"location":"#User-Guide","page":"Home","title":"User Guide","text":"For detailed usage instructions and examples, see the User Guide.","category":"section"},{"location":"#Developer-Guide","page":"Home","title":"Developer Guide","text":"For information on contributing to this project, see the Developer Guide.","category":"section"},{"location":"#Support","page":"Home","title":"Support","text":"Feature requests and bug reports are handled via GitHub Issues.","category":"section"},{"location":"#API-Reference","page":"Home","title":"API Reference","text":"","category":"section"},{"location":"#Citation","page":"Home","title":"Citation","text":"CITATION.bib is available for citing this package.\n\nfile = open(\"../../CITATION.bib\", \"r\") # hide\ntext = Base.read(file, String) # hide\nclose(file) # hide\nprintln(text) # hide","category":"section"},{"location":"#License","page":"Home","title":"License","text":"This package is released under the MIT License.\n\nfile = open(\"../../LICENSE\", \"r\") # hide\ntext = Base.read(file, String) # hide\nclose(file) # hide\nprintln(text) # hide","category":"section"},{"location":"#Acknowledgment","page":"Home","title":"Acknowledgment","text":"This package is written in the Julia programming language, built on an initial project template generated using PkgStarter.jl. This repository is hosted on GitHub, and continuous integration is run using GitHub Actions.","category":"section"}]
